import React from 'react';

const Pagination = () => {
    const pages = [1, 2, 3, 4, 5]

    return (
        <div className='pagination'>
            {pages.map(page =>
                <div className='pagination__page'>{page}</div>
            )}
        </div>
    );
};

export default Pagination;
